  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <a href="/">
                <i className="bi bi-house-door" style={{ fontSize: '29px' }} />
              </a>
            </li>
            <li>
              <a href="/about">
                <i className="bi bi-info-circle" style={{ fontSize: '29px' }} />
              </a>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/">
            <Homepage />
          </Route>
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
